import React, { Component } from 'react';
import { Tabs, Tab, Grid, Cell, Card, CardTitle, CardText, CardActions, Button, CardMenu, IconButton } from 'react-mdl';
import dsalgoImg from './../img/dsalgo-img.jpeg';



class Projects extends Component {

    constructor(props) {
        super(props);
        this.state = {activeTab: 0};
    }

    toggleCategories() {


        if (this.state.activeTab === 0) {
            return(
                <div className="projects-grid">
                    {/* Project 1 */}
                    <Cell col={4}>4</Cell>
                    <Cell col={4}>4</Cell>
                    <Cell col={4}>4</Cell>
                    <Card shadow={2} style={{minWidth: '450', margin: 'auto'}}>
                        <CardTitle style={{color: '#fff', height: '176px', background: 'url(https://www.adobe.com/content/dam/cc/us/en/products/illustrator/icon-design/desktop/SEO_single-app_icon-design_P2b_416x208.jpg.img.jpg) center / cover'}}>Maze game</CardTitle>
                        <CardText>
                            Maze game built in MIPS assembly. Randomely generates a maze on a bit map.
                            User can use their keyboard to move the bit from start to goal.
                        </CardText>
                        <CardActions border>
                            <Button colored>GitHub</Button>
                        </CardActions>
                    </Card>

                    {/* Project 1 */}
                    <Card shadow={2} style={{minWidth: '450', margin: 'auto'}}>
                        <CardTitle style={{color: '#fff', height: '176px', background: 'url(https://www.adobe.com/content/dam/cc/us/en/products/illustrator/icon-design/desktop/SEO_single-app_icon-design_P2b_416x208.jpg.img.jpg) center / cover'}}>Maze game</CardTitle>
                        <CardText>
                            Maze game built in MIPS assembly. Randomely generates a maze on a bit map.
                            User can use their keyboard to move the bit from start to goal.
                        </CardText>
                        <CardActions border>
                            <Button colored>GitHub</Button>
                        </CardActions>
                    </Card>



                </div>

            )
        }
        else if (this.state.activeTab === 1) {
            return(
                <div><h1>This is Python</h1></div>
            )
        }
        else if (this.state.activeTab === 2) {
            return(
                <div><h1>This is ML</h1></div>
            )
        }
        else if (this.state.activeTab === 3) {
            return(
                <div><h1>This is Other</h1></div>
            )
        }
        else {
            return(
                <div><h1>This is DS & Algo</h1></div>
            )
        }
    }


    render() {
        return(
            <div className="category-tabs">

                <Tabs activeTab={this.state.activeTab} onChange={(tabId) => this.setState({activeTab: tabId})} >
                    <Tab>DS & Algorithms</Tab>
                    <Tab>Python</Tab>
                    <Tab>Machine Learning</Tab>
                    <Tab>Other</Tab>
                </Tabs>


                <Grid>
                    <Cell col={12}>
                        <div className="content">{this.toggleCategories()}</div>
                    </Cell>
                </Grid>

            </div>
        )
    }
}


export default Projects;
